/* Unpacks the comressed character translation table */
func zzUnpackCMap(packed []int) []rune {
	m := make([]rune, 0x10000)
	j := 0 // index in unpacked array
	var count int
	for i, value := range packed {
		if i%2 == 0 {
			count = value
		} else {
			m[j] = rune(value)
			j++
			count--
			for count > 0 {
				m[j] = rune(value)
				j++
				count--
			}
		}
	}
	return m
}

